      data[2] = 0x00;
      data[3] = 0x04; // 数据长度

      data[4] = 0xE0;
      data[5] = 0x00; // 运行命令字
      if (fileLength <= 255) {
        data[6] = 0x00;
        data[7] = Number(fileLength);
      } else {
        data[6] = Number(fileLength) >> 8;
        data[7] = Number(fileLength) & 255; // 升级程序的长度
      }

      var crcData = this.uiCRC16(fileData, fileLength);
      // 升级程序的 CRC 校验
      // data.set(this.uiCRC16(fileData, fileLength), 8);
      if (crcData <= 255) {
        data[8] = 0x00;
        data[9] = Number(crcData);
      } else {
        data[8] = Number(crcData) >> 8;
        data[9] = Number(crcData) & 255; // 升级程序的长度
      }
      crcData = this.uiCRC16((data.subarray(0, 10), 10));

      // 这一帧数据包的CRC校验
      if (crcData <= 255) {
        data[10] = 0x00;
        data[11] = Number(crcData);
      } else {
        data[10] = Number(crcData) >> 8;
        data[11] = Number(crcData) & 255; // 升级程序的长度
      }

